import React from 'react';
import text from '../assets/text.png'
import About from './CountDown';

const Home = () => {
  return (
      <div className="w-screen h-auto p-4">
        <div className="flex flex-col items-center justify-center my-60">
            <img src={text} alt="" className='w-3/4 h-60'/>    
            <div className='text-center font-potta-one text-8xl font-normal leading-none text-[#f9f5e3] animate-bounce'>November 8-10</div>
            <button className='bg-[#36382E] my-8 w-96 h-24 rounded-[16px] text-2xl font-space-mono text-[#F9F5E3] transition ease-in-out delay-100 hover:font-bold hover:-translate-y-1 hover:scale-110 hover:bg-indigo-500 duration-100'>Apply as Hacker</button>
        </div>        
        <About />
    </div>
  );
};

export default Home;
